import '../styles/Crew.css';
import * as assets from "../utils/assets"
import {crew} from "../data"

function Crew() {
    return (
        <div className="crew-container">
            <h1 className="title">02 MEET YOUR CREW</h1>
            <div className="member-infos">
                <h1 className="job"></h1>
                <h1 className="name">{crew[0].name}</h1>
                <p className="desc"></p>
                <div>
                    navigator
                </div>
            </div>
        </div>
    );
}

export default Crew;
